Add to your MCP client configuration:

Get your Figma API key from [Figma Developer Settings](https://www.figma.com/developers/api#authentication).

```json
{
  "feuse-mcp": {
    "command": "npx",
    "args": ["feuse-mcp@latest"],
    "env": {
      "FIGMA_API_KEY": "YOUR_FIGMA_API_KEY"
    }
  }
}
```

